//Lista somatorio de tempo em segundos agrupando por app e por dia
SELECT TD_AUX.APLICATIVO,TD_AUX.DATA_INICIO,COUNT(1) AS QUANTIDADE_ACESSOS, SUM(TD_AUX.DIF_SEG) AS TEMPO_EM_SEGUNDOS
FROM 
(SELECT AUX.APLICATIVO AS APLICATIVO,
        strftime('%Y-%m-%d',AUX.DATA_HORA_INICIO) AS DATA_INICIO,
        (strftime('%s',AUX.DATA_HORA_FINAL) - strftime('%s',AUX.DATA_HORA_INICIO)) AS DIF_SEG,
        ABS((strftime('%s',AUX.DATA_HORA_FINAL) - strftime('%s',AUX.DATA_HORA_INICIO))/60) AS DIF_MIN,
        ABS(((strftime('%s',AUX.DATA_HORA_FINAL) - strftime('%s',AUX.DATA_HORA_INICIO))/60)/60) AS DIF_HOR,
        ABS((((strftime('%s',AUX.DATA_HORA_FINAL) - strftime('%s',AUX.DATA_HORA_INICIO))/60)/60)/24) AS DIF_DIA
  FROM ESTATISTICA AS AUX) TD_AUX
 GROUP BY TD_AUX.APLICATIVO,TD_AUX.DATA_INICIO;


